import React, { useState } from "react";
import { Link } from "react-router-dom/cjs/react-router-dom.min";
import "./partner.css";
export default function Partner() {
  const [price, setprice] = useState("");

  const SearchPrice = (e) => {
    e.preventDefault();
  };
  return (
    <div className=" search-price ">
      <div className="text-center text">Tư vấn chọn hoa</div>
      <div className="">
        <form className="" onSubmit={SearchPrice} encType="multipart/form-data">
          <select>
            <option value={0}> Danh mục</option>
            <option value={0}>
              <Link to=""> Hoa Bo</Link>
            </option>
            <option value={0}> Hoa khai</option>
            <option value={0}> Hoa vip</option>
            <option value={0}> Hoa khuyen mai</option>
          </select>
          <select>
            <option value={0}> Mức giá</option>
            <option value={0}> 100</option>
            <option value={0}>200</option>
            <option value={0}> 300</option>
            <option value={0}> 400</option>
          </select>
          <Link to=""> Tim ngay</Link>
        </form>
      </div>
    </div>
  );
}
